    return (
		<div className='Register'>
			<Navbar />
			<h1>Register</h1>
			<h2>Email:</h2>
			<div>
				<TextInput
					placeholder=""
					regex={/^[a-zA-Z0-9_@.]+$/}
					valueRef={emailRef}
					enterFunction={registerAccount}
				/>
			</div>

			<h2>First Name:</h2>
			<div>
				<TextInput
					placeholder=""
					regex={undefined}
					valueRef={firstNameRef}
					enterFunction={registerAccount}
				/>
			</div>

			<h2>Last Name:</h2>
			<div>
				<TextInput
					placeholder=""
					regex={undefined}
					valueRef={lastNameRef}
					enterFunction={registerAccount}
				/>
			</div>

			<h2>Password:</h2>
			<div>
				<TextInput
					placeholder=""
					regex={undefined}
					valueRef={passwordRef}
					enterFunction={registerAccount}
				/>
			</div>
        </div>
    );
}

export default Register;
